    temperature, salinity and other variables collected from discrete sample and profile
    observations using Alkalinity titrator, CTD and other instruments from the JAKOV
    SMIRNITSKIY in the Beaufort Sea, East Siberia Sea and others from 2008-08-15 to
    2008-09-16 (NODC Accession 0108368)",nt"tracking_summary": {ntt"total":
    3,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-09-26T21:01:07.937779",nt"name": "dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-fro9555a",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0108368 includes chemical,
    discrete sample, physical and profile data collected from JAKOV SMIRNITSKIY in the
    Beaufort Sea, East Siberia Sea, Kara Sea and Laptev (or Nordenskjold) Sea from 2008-08-15
    to 2008-09-16 and retrieved during cruise 90JS20080815. These data include ALKALINITY,
    AMMONIUM, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
    (CFC-12), Carbon tetrachloride (CCL4), DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN,
    HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, SALINITY, SILICATE, WATER TEMPERATURE
    and pH. The instruments used to collect these data include Alkalinity titrator,
    CTD, Coulometer for DIC measurement, Spectrophometer for pH measrement and bottle.
    These data were collected by Igor Semiletov of Pacific Oceanological Institute,
    Orjan Gustafsson of Stockholm University, Igor Semiletov of University of Alaska
    - Fairbanks; International Arctic Research Center and Leif Anderson of University
    of Gothenburg as part of the CLIVAR_ISSS_08 data set.nnThe International CLIVAR
    Global Ocean Carbon and Repeat Hydrography Program carries out a systematic and
    global re-occupation of select WOCE/JGOFS hydrographic sections to quantify changes
    in storage and transport of heat, fresh water, carbon dioxide (CO2), and related
    parameters.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
